import React, {Component} from 'react';
import { Query } from 'react-apollo';
import gql from 'graphql-tag';

const getAll = gql`
  query {
    quotes {
      id
      quote
    }
  }
`;

const Quotes = (props) => {
  return <div className="quote-wrapper">
    {`${props.quote}`}
  </div>
}

export default Quotes;
